// import DropDown from './DropDown';

const Navbar = () => {
    return (
        <nav className="flex justify-between p-2 px-2 bg-stone-100">
            <h1 className="text-blue/60 p-2">Logo</h1>
            <div>
                <span>
                    <a href="/">Home</a>
                </span>
                <span>DropDown</span>
            </div>
        </nav>
    );
};

export default Navbar;
